INSERT INTO `email_template` VALUES (1,1,3,NULL,NULL,1,'Free Buyer\'s Guide PDF',NULL,'Free Buyer\'s Guide PDF from Solaris Panels',NULL,NULL,'Thank you for visiting the website (http://www.solaris-panels.com) and requesting the Buyer\'s Guide.\nView the Buyer\'s Guide (http://www.solaris-panels.com/)\nSincerely,\n%%user_name%%\ninfo@solaris-panels.com\nwww.solaris-panels.com\n\n%%account_address%%\n%%unsubscribe%%',NULL,NULL,NULL,1,0,0,0,1,1,1,1,0,NULL,NULL,NULL,NULL,'2007-07-29 10:42:51','2016-03-24 16:06:58'),(2,1,3,NULL,NULL,1,'Special Follow-up Offer - HTML',NULL,'Special Follow-up Offer from Solaris Panels',NULL,NULL,NULL,'<h1>Thank you</h1><h4>We appreciate your inquiry:<br/></h4><p>%%account_address%%</p><p>%%unsubscribe%%</p>',NULL,NULL,2,0,0,0,1,1,1,1,0,NULL,NULL,NULL,NULL,'2007-07-29 10:42:51','2016-03-24 16:06:58'),(3,1,3,NULL,NULL,1,'Product Pricing Information - Multipart',NULL,'Pricing Information from Solaris Panels',NULL,NULL,'Thank you.\n\nWe appreciate your inquiry:\n\n%%account_address%%\n%%unsubscribe%%','<h1>Thank you</h1><h4>We appreciate your inquiry:<br/></h4><p>%%account_address%%</p><p>%%unsubscribe%%</p>',NULL,NULL,3,0,0,0,1,1,1,1,0,NULL,NULL,NULL,NULL,'2007-07-29 10:42:51','2016-03-24 16:06:58'),(4,1,3,NULL,NULL,1,'Intro Email 1',NULL,'Welcome 1',NULL,NULL,'Hi INSERT_FIRST_NAME,\r\n\r\nMake your next meeting a smash! Your attendees are coming to learn, so your educational sessions had better knock it out of the park or you can guess what people will be talking about while networking.\r\n\r\nThe bottom line is: The better your speakers, the better the sessions; the better your sessions, the better you and your organization look. With that in mind, weve pulled together some helpful information to prepare your speakers for success. Watch for tips in every issue of eNews.\r\n\r\n-- ePoll - Going Green? \r\n-- Better Meetings - Tips for Publications, Sessions and Speakers\r\n-- Resources For Meeting Professionals\r\n-- Industry Meetings and Events\r\n-- Marketing Updates - New digital printing equipment, CD packaging and flash drives\r\n\r\nRemember, if you have an upcoming meeting that requires educational materials in print or CD, or if you need assistance with collecting final speaker files, it\'s not too late for us to help. We work within very tight timelines and will accommodate your changing content.\r\n\r\nCall me at 866-828-0305 to or visit http://www.marketing.com to learn more.\r\n\r\nView your Marketing eNewsletter here\r\nhttp://www.site.net/actions/email_web_version.cfm?recipient_id=999999999&message_id=INCLUDEMESSAGEID&user_id=INCLUDEUSERID&group_id=INCLUDEGROUPID\r\n\r\n\r\nCheers!\r\n\r\nINSERT_CUSTOM03\r\nINSERT_CUSTOM16\r\n\r\nMarketing\r\n2600 Anderson Street\r\nMadison, WI 53704\r\n866-828-0305\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n.\r\n\r\n.\r\n%%account_address%%\r\nClick here to unsubscribe: %%unsubscribe%%',NULL,NULL,NULL,1,0,0,0,1,1,1,1,0,NULL,NULL,NULL,NULL,'2007-07-29 10:42:51','2016-03-24 16:06:58'),(5,1,6,NULL,NULL,1,'Drip Marketing - Introduction',NULL,'Thank You For Your Interest in Pardot',NULL,NULL,'%%first_name%%,\r\nAs a follow-up to our recent conversation, I thought you may be interested in learning more about marketing automation technology and how Pardot can play an important role in your overall web marketing strategy by increasing sales and providing ROI for your marketing initiatives.\r\n\r\nOver the next few weeks, I\'ll send you some relevant resources along with additional information about Pardot.\r\n\r\nIn the meantime, I would be happy to answer any questions you may have about Pardot and further discuss how marketing automation can be beneficial to your team. Please feel free to contact me - I look forward to speaking with you soon.\r\n\r\nWarmest regards,\r\n\r\n%%user_name%%\r\n %%user_job_title%%\r\n %%user_phone%%\r\n\r\nPardot\r\nNo Hassle Marketing Automation\r\nwww.pardot.com\r\n\r\n %%account_address%%\r\n\r\n