 components of your B2B lead generation campaigns: lead scoring and nurturing.\r\n\r\nThe white paper will show you how to:\r\n\r\nScore leads based on implicit buying signals\r\nGrade leads based on how well they fit your ideal customer profile\r\nSet up autoresponder and drip marketing emails to nurture prospects\r\n\r\nAutomatically alert your sales reps when their leads become sales-ready\r\n\r\nView the white paper.\r\nhttp://www2.pardot.com/l/1/2009-03-05/C3X0G/10054_Automate_Nurturing_and_Scoring.pdf\r\n\r\nPlease also enjoy a flash demo\r\nhttp://pardot.com/files/flash/\r\n\r\n of Prospect Insight. If you have any questions about how Pardot can develop a customized lead qualification system for your team, please don\'t hesitate to contact me.\r\n\r\nWarmest regards,\r\n\r\n%%user_name%%\r\n%%user_job_title%%\r\n%%user_phone%%\r\n\r\nPardot\r\nNo Hassle Marketing Automation\r\nwww.pardot.com\r\n\r\n%%account_address%%\r\n\r\nUnsubscribe\r\n%%unsubscribe%%\r\n\r\n from Pardot mailings.','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html>\r\n<head>\r\n<title>Untitled document</title>\r\n</head>\r\n<body>\r\n<table style=\"width: 100%; text-align: left;\" bgcolor=\"#336699\" cellpadding=\"10\" cellspacing=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\" valign=\"top\">\r\n<table style=\"width: 600px;\" cellpadding=\"0\" cellspacing=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"border-top: 0px solid #333333; border-bottom: 10px solid #ffffff; background-color: #ffffff;\" align=\"left\" valign=\"middle\"><center><span style=\"font-family: arial,helvetica,sans-serif;\"><img id=\"editableImg1\" style=\"border: 0px solid; width: 600px; height: 110px;\" alt=\"Header\" src=\"http://www.pardot.com/files/images/marketing/header_png.PNG\" /></span></center></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table style=\"width: 600px; background-color: #ffffff; text-align: left;\" cellpadding=\"20\" c