INSERT INTO `event` VALUES (1,1,6,'1','Celtic Thunder','Celtic Thunder Mythology tells the story of our ancestors in Ireland, their legends, their history and their stories. Its the lifeblood of modern day Ireland and its influences from our Celtic past that are that are still reflected in its people today. Like the Celts, Mythology is bold, challenging, strong, proud and steeped in history. In Mythology, the old and the new combine, modern catalyst images are projected onto ancient standing stones, a giant Celtic cross takes center stage and the tempo of the music is strongly echoed in the theatrical and moody lighting.',1,100,'America/New_York',NULL,'The Center for the Performing Arts - Carmel, IN','http://www.thecenterfortheperformingarts.org/','Palladium',100,35,'2013-10-18 20:00:00','2013-10-18 22:00:00',NULL,NULL,0,0,'2016-03-24 16:06:59','2016-03-24 16:06:59'),(2,1,6,'2','Dance Kaleidescope Dances Mother Goose','A thrilling collaboration with Dance Kaleidescope offers patrons the rare opportunity to explore the dynamic combination of orchestra and dance.  Mahler\'s spectacular Symphony No. 1 closes out this season opening concert.',3,100,'America/New_York',NULL,'The Center for the Performing Arts - Carmel, IN','http://www.thecenterfortheperformingarts.org/','Palladium',100,35,'2013-10-10 20:00:00','2013-10-10 22:00:00',NULL,NULL,0,0,'2016-03-24 16:06:59','2016-03-24 16:06:59'),(3,1,6,'3','Gloria Gaynor','I Will Survive climbed to the top of Billboards Pop Charts in 1979, claiming the',3,100,'America/New_York',NULL,'The Center for the Performing Arts - Carmel, IN','http://www.thecenterfortheperformingarts.org/','Palladium',100,35,'2013-09-28 20:00:00','2013-09-28 22:00:00',NULL,NULL,0,0,'2016-03-24 16:06:59','2016-03-24 16:06:59');
